import React, { Fragment } from "react";
import { Search } from "../components/Search";
import { Card } from "../components/Card";

export const Home = () => {
    const cards = new Array()
    .fill()
    .map((_,i)=>i)
    return (
        <Fragment>
            <Search />
            <div className="row">
               {cards.map}
            </div>
        </Fragment>
    )
}
